DROP TABLE IF EXISTS `User`;
CREATE TABLE `User` (
  `userId` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'user identity',
  `userCanLogin` int(2) NOT NULL DEFAULT '1',
  `userIdExternal` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '-1' COMMENT 'external id',
  `userIdExternalFacebook` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '-1' COMMENT 'external id',
  `userIdExternalTwitter` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '-1' COMMENT 'external id',
  `userMatrikelNummer` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `userType` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `userGeneric` int(2) NOT NULL DEFAULT '0',
  `userGroup` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `userClass` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `userStatus` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT 'active',
  `userName` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `userPreName` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `userStreet` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `userTown` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `userZip` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `userCountry` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `userPhone` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `userEmails` tinytext CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'emails  separated',
  `userLogin` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'user login',
  `userPassword` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'user password',
  `userPasswordNew` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `userAvatar` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `userIconStatus` varchar(255) NOT NULL DEFAULT 'default',
  `userInvitationStatus` varchar(255) NOT NULL DEFAULT 'no',
  `userInvitationPassword` varchar(255) NOT NULL,
  `userCreate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'user create',
  `userLastUpdate` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'user last update',
  PRIMARY KEY (`userId`)
) ENGINE=MyISAM AUTO_INCREMENT=3483 DEFAULT CHARSET=utf8;

